import ToggleButton from "react-bootstrap/ToggleButton";
import ToggleButtonGroup from "react-bootstrap/ToggleButtonGroup";
import { useState } from "react";
import Badge from "react-bootstrap/Badge";
import ListGroup from "react-bootstrap/ListGroup";
import Alert from "react-bootstrap/Alert";
import Table from 'react-bootstrap/Table';


 


function ToggleButtonGroupUncontrolled() {
  const [show, setShow] = useState(true);

  if (show) {
    return (
      <Alert variant="danger" onClose={() => setShow(false)} dismissible>
        <Alert.Heading>Oh snap! You got an error!</Alert.Heading>
        <p>
          Change this and that and try again. Duis mollis, est non commodo
          luctus, nisi erat porttitor ligula, eget lacinia odio sem nec elit.
          Cras mattis consectetur purus sit amet fermentum.
        </p>
      </Alert>
    );
  }
  return (
    <>
     
        <ListGroup.Item
          as="li"
          className="d-flex justify-content-between align-items-start"
        >
          <div className="ms-2 me-auto">
            <div className="fw-bold">Subheading</div>
            <ToggleButtonGroup type="radio" name="options" defaultValue={1}>
              <ListGroup horizontal>
                <ListGroup.Item>
                  {" "}
                  <ToggleButton id="tbg-radio-1" variant="dark" value={1}>
                    Radio 1
                  </ToggleButton>
                </ListGroup.Item>
                <ListGroup.Item>
                  <ToggleButton id="tbg-radio-2" variant="secondary" value={2} onClick={() => setShow(true)}>
                    Radio 2
                  </ToggleButton>
                </ListGroup.Item>
                <ListGroup.Item>
                  <ToggleButton id="tbg-radio-3" variant="dark" value={3}>
                    Radio 3
                  </ToggleButton>
                </ListGroup.Item>
                <ListGroup.Item>
                  <ToggleButton id="tbg-radio-4" variant="dark" value={4}>
                    Radio 4
                  </ToggleButton>
                </ListGroup.Item>
              </ListGroup>
            </ToggleButtonGroup>
          </div>
          <Badge bg="primary" pill>
            14
          </Badge>
        </ListGroup.Item>
      
    </>
  );
}

export default ToggleButtonGroupUncontrolled;
